import React from 'react';
import logo from '../../logo.svg';

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {name: props.name}
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>
            Hello, {this.state.name}.
          </p>
        </header>
      </div>
    );
  }
}

export default App;
